const URL = 'http://localhost:4000/rest/movies';

export const findAllMovies = () =>
    fetch(URL)
    .then(response => response.json());

export const deleteMovie = (id) =>
    fetch(`${URL}/${id}`, {
      method: 'DELETE',
    });

export default {
  findAllMovies
};
